		title:
			"Founded in 1795 and passed down through one family for the past seven generations, Jim Beam is the world's best-selling bourbon. From Tokyo to London to Louisville, Jim Beam sets the benchmark for what a bourbon should be, aged twice as long as required by law for a flavor that's unlike any other. Distilled with corn, malted barley, time, pride and passion, there's a reason why Jim Beam Bourbon is on almost every bar shelf. However, it isn't the name that should entice you. Opening a bottle is the best way to celebrate life events, gatherings, or just hanging out with friends. It's as versatile as it is smooth, something you've probably always aspired to be, yet it does so effortlessly.\n\nTo get the distinct flavor of Jim Beam Bourbon, the distillery ages the liquor in charred oak barrels for a minimum of four years. This imparts a medium body and a caramel color that you've come to know in a bourbon. The oaky, vanilla and spicy backdrop greets you with a swirling of the bourbon, inviting you to taste what lies within the glass. When you finally raise the glass, your taste buds become overwhelmed with a five-pronged attack of sweetness, grain, oak, char and fruit. Most five-pronged attacks are best left to the battlefield or sporting event, but this bludgeons you over the head with flavors that keep you coming back. Enjoy Jim Beam Bourbon on the rocks, with a splash of water or in one of your favorite cocktails.\nBeam Suntory",

