		brandName: "CIROC",
		title:
			"Distilled five times from French grapes and packed with a punch of infused pineapple and coconut, Ciroc Summer Colada vodka is sure to start the party off right. As soon as you pour a glass of this limited-time offering, you get a pungent aroma of tropical fruits and other natural flavors, but the true joy comes when it hits your lips. Creamy coconut and juicy pineapple hit your tongue, transporting you to some far-off paradise with sapphire blue water, palm trees and a never-ending social scene.\n\nThere's no wrong way to drink Ciroc Summer Colada; it's just a matter of preference. Served on the rocks, it's a relaxing journey, but a chilled shot gives you all the flavor without having to hold the glass. If you're into cocktails, mix this vodka into anything even remotely resembling a tropical drink and be transported to the tropical islands.\n\nOne of the most interesting combinations is Summer Colada in a piña colada. This island-inspired drink normally pairs with white rum, but the Ciroc Summer Colada derivative is nothing short of spectacular. You can also try Ciroc's very own Colada Remix, which is a simple blend of two parts pineapple juice to one-part Summer Colada. No matter what drink you choose, there's no denying that dreaming of the Caribbean is just one sip away.\n\nBuy Ciroc Summer Colada online at a great price through Drizly today and start enjoying the flavor of summer in a glass.",

