			"Haku® is the Japanese craft vodka from the House of Suntory. The name Haku means “white” in Japanese and refers to the Japanese white rice that is the origin of the liquid. Moreover, it can also be read as “brilliant” – a tribute to the craft of mastering a clear, clean, and luminous vodka. Suntory has been making vodka since 1956, and Haku represents Suntory’s philosophy of craftsmanship, meticulous attention to detail, and commitment to quality.\n\nHaku® is made with 100% Japanese white rice. It has 3 distinct steps in the distillation process: First, Japanese rice is fermented and distilled through a pot still to create a rice spirit in Kagoshima, Japan Then, the rice spirit is distilled a second time through 2 different processes in a pot still and column still to create a uniquely flavored liquid Finally, the liquid is blended and then filtered through bamboo charcoal in Osaka, Japan The resulting liquid’s taste profile is clean, soft, and smooth with a sweet rice flavor.",

