		title:
			"Drinking scotch is not for the faint of heart. However, that doesn't mean it comes with a huge price tag. That's why there's Dewar's White Label. Distilled for the man or woman who wants a smooth scotch without all the extras, Dewar's White Label is where it's at, wherever you want to be.\n\nSince 1899, this scotch whiskey has been produced with a time-honored traditional distillation process. Honey, vanilla, apple and wood combine into a versatile and soothing mix with an aftertaste of smokiness and a bit of fudge. That means you can indulge in divine chocolatey goodness without having to head to a candy shop or the grocery store.\n\nThe best way to drink Dewar's White Label is to uncork it and let it breathe. Wait just a few minutes before you pour it into your favorite rocks glass or snifter. This allows the blend to explode with flavor, leaving you in its wake. It's not often you want to take a grenade to the face, but if it's Dewar's White Label, you'll probably let it slide. A predisposition for mischief may also call for a Dewar's on its own. Keep this in the cabinet for times that call for fun and playfulness.\n\nIf you simply must have a cocktail, Dewar's White Label is nothing short of a fantastic mixer. Blend it with sweet vermouth and bitter for a classy Rob Roy. For something subtler, combine equal parts Dewar's White Label with amaretto for a delicious beverage.\n\nBuy Dewar’s White Label online at a great price through Drizly and have it delivered directly to your door or pick it up in store.",

