		brandName: "Beefeater",
		title:
			"When only a tried-and-true dry gin will do, turn to Beefeater London Dry Gin. The gin's recipe dates to 1863 and has stood the test of time, becoming the most award-winning gin over the last decade. Bottled at 40 percent alcohol by volume, Beefeater London boasts maximum flavor in every bottle. You will adore the spiced, fruity notes that make Beefeater comparable to more premium brands, only you'll save a fortune when stocking the liquor cabinet!\n\nNamed after the Tower of London ceremonial guards, Beefeater Gin is bottled and distributed by the company James Burrough in the United Kingdom. The Beefeater distillery is one of only nine still operating in London itself. Beefeater London Dry Gin contains a lovely array of botanicals, including angelica root and seeds, juniper, coriander seeds, almonds, licorice, Seville oranges, lemon peel and orris root. The production process involves steeping these botanicals for a full 24 hours before distillation to fully extract the flavors.\n\nThe best way to enjoy Beefeater London's flavors is to sip it straight. It's a dry gin with a wonderful herbal bouquet and a citrus back. If you prefer your gin mixed in cocktails, infuse it with a sweet vermouth or use it in a classic gin and tonic. Try mixing a Gin St. Clements, which is Beefeater dry gin, fresh orange and lemon juice and tonic.\n\nBuy Beefeater Gin online at a great price through Drizly and have it delivered directly to your door or pick it up in store.",

