		title:
			"Del Maguey Vida San Luis Del Rio Mezcal is the perfect place to start when you want to try mezcal. This Mexican liquor is a little harder to find than tequila and other options, but Del Maguey has made its Vida Mezcal easy to get and at an entry-level price. It tastes delicious in mixed drinks and will introduce you to the world of mezcal.\r\n\r\nThis mezcal is distilled twice and hand-crafted. Del Maguey uses wood-fired copper stills, which bring out fruity aromas and other sweet notes such as honey and vanilla. On your palate, experience cinnamon, banana, tangerine and even sandalwood.\r\n\r\nWondering why you should opt for mezcal over tequila? Both mezcal and tequila are Mexican liquors distilled from the agave plant. Mezcal and tequila come from different regions in Mexico and often from different varieties of agave plant. Tequila must come from the Blue Agave plant, while mezcal can come from any agave plant. Most mezcal comes from Agave Espadin, including the Del Maguey Vida variety.\r\n\r\nThough you can try sipping Del Maguey Vida Mezcal to understand what mezcal is and how it should taste, this mezcal is designed to taste delicious in cocktails. The fruit notes and long finish make it perfect for fruitier mixes, such as a Sierra Madre Sunrise, which is made of mezcal plus Aperol, chocolate bitters and lemon juice. Try making a Mezcal Julep with basil and cranberry for a fruity twist on the classic. Remember to use quality juices and ripe fruits for best results.\r\n\r\nBuy Del Maguey Vida Mezcal online through Drizly and have it delivered directly to your door or pick it up in store.",

